import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export const Login = () => {
  const [user, setUser] = useState(null);
  const navigate = useNavigate();

  const handleClick = () => {
    navigate('/');
  };

  if (user) {
    return <h1>Logged in</h1>;
  }
  return <button onClick={handleClick}>Click here</button>;
};
